import React from "react";
import "../../App.css";
import Cards from "../Cards";
import HeroSection from "../HeroSection";
import Footer from "../Footer";
import Customer from "../Customer";
import Slideshow from "../Slideshow ";

function Home() {
  return (
    <>
      <HeroSection />
      <Cards />
      <Customer />
      <Footer />
      <Slideshow />
    </>
  );
}

export default Home;
